def parse_log(num, action):
#    print(len(action))
    a, b = struct.unpack('QQ', action[:16])
    if not a == eosio:
        return
    if b == setcode:
        print('+++++++++++++++', num, n2s(a), n2s(b))
    elif b == newaccount:
        creator, name = struct.unpack('QQ', action[16:16+16])
        creator = n2s(creator)
        name = n2s(name)
        print(creator, name)
        return
        if name.find('eosio') >=0:
            print('create system account:', creator, name)

